import React, { Component } from 'react';
import { Segment, Container, Divider, Header } from 'semantic-ui-react';
import Layout from '../components/Layout';

class AboutPage extends Component {
  render() {
    return (
      <Layout>
        <Container>
          <Divider hidden/>
          <Segment raised textAlign={"center"}>
            <Header>
              SCSE19-0299: Block-Chain Based Question Answering System
            </Header>
            Please use a valid NTU Student Email Address to be bounded to the Etheruem Account to use the Application
          </Segment>
        </Container>
      </Layout>
    )
  }
}

export default AboutPage;
